            <li>
              <p> {user.name} </p>
            </li>
          )}
        {isAuthenticated ? (
            <li>
              <Button
                onClick={() => logout({ returnTo: window.location.origin })}>
                Log Out
              </Button>
            </li>
          ) : (
            <li>
              <Button onClick={() => loginWithRedirect()}>Log In</Button>
            </li>
          )}
      </ul>
    </div>
  );
};

export default Navbar;
